import React, { useEffect, useState } from "react";
import axios from "axios";
const Photo = () => {
  const [buf, setbuf] = useState(null);
  return (
    <div>
      <div className="anima"></div>
      <style jsx>{`
        .anima {
          width: 100%;
          height: 200px;
          animation: show 2s infinite;
        }
        img {
          width: 100%;
        }
        @keyframes show {
          0% {
            background: #202930;
          }
          50% {
            background: #0f171d;
          }
          100% {
            background: #202930;
          }
        }
      `}</style>
    </div>
  );
};

export default Photo;
